import React, { Component } from "react";

export default class RangeBarReact extends Component {
  render() {
    return (
      <div>
        <div className="d-flex justify-content-center my-4">
          <span className="font-weight-bold purple-text mr-2 mt-1">0</span>
          <div className="range-field w-20">
            <input
              className="border-0"
              type="range"
              min="0"
              max="100"
              value={100}
              onChange={e => console.log(e)}
            />
          </div>
          <span className="font-weight-bold purple-text ml-2 mt-1">10</span>
        </div>
      </div>
    );
  }
}
